            name= {name}
            description= {description}
            key={index}
          > 
          </Tile>;
          
          
        })*/
        objects.map((obj)=>{
          <Tile
            name= {obj.name}
            description= {obj}
            key={index}
          > 
          </Tile>;
        })
      }
    </div>
  );
};
